import React, { useEffect } from 'react';
import './Money.css';
import Bill from './Bill';
import Coin from './Coin';
import { FaMoneyBill, FaBitcoin } from 'react-icons/fa';


function Money(props) {
    console.log(props);
    const showBill = props.bank.map((bill)=> <Bill id={bill[0]} type={bill[0]} amount={bill[1]}/>)
    const showCoin= props.coin.map((coin)=> <Coin id={coin[0]} type={coin[0]} amount={coin[1]}/>)
    return (
        <div className="Money">
            <table className="BillTable">
                <tr>
                    <td>
                        <tr className='InnerTr'>
                            <center><FaMoneyBill className='billIcon'/></center>
                        </tr>
                        <tr className='InnerTr'>
                            <p className="moneyEle amountEle">Amount:</p>
                        </tr>


                    </td>
                {showBill}
                </tr>

            </table>

            <table className="CoinTable">
                <tr>
                    <td>
                        <tr className='InnerTr'>
                            <center><FaBitcoin className='coinIcon'/></center>
                        </tr>
                        <tr className='InnerTr'>
                            <p className="moneyEle amountEle">Amount:</p>
                        </tr>


                    </td>
                {showCoin}
                </tr>

            </table>


        </div>
    );
}

export default Money;
